float diy_sin(float x)
{
int16_t count = x / (2.*M_PI); //zaokraglane w kierunku zera
x -= 2*M_PI * (float)count; //sprowadzam do zakresu [-2pi, 2pi]
int16_t flag = 0;

if(x < 0)
{
    x += 2.*M_PI; //korzystam z okresowosci, by [0, 2pi]
}

if(x > M_PI) //tne na pol
{
    x -= M_PI;
    flag = !flag;
}

return 16.* x * (M_PI-x) / (5. * M_PI * M_PI - 4.*x *(M_PI - x)) * (flag ? -1. : 1.);
}

float diy_cos(float x)
{
    return diy_sin(x+M_PI/2.);
}





void FFT(struct fix32_t * result_real, struct fix32_t * result_img)
{

for(uint32_t L = 1; L < WSIZE; L<<=1 ) //krok pomiedzy blokami o innym range motylka
{
    
    for(uint32_t m = 0; m < L; m +=1) //krok w ramach motylka (0,1), (0,1,2,3) itd.
    {

        struct fix32_t w_r = fix32_t_div(fix32_t_cos((float) m * 2. * M_PI /(float) WSIZE) , int32_t_fix32_t(2));
        struct fix32_t w_i = fix32_t_div(fix32_t_sin((float) m * 2. * M_PI / (float) WSIZE) , int32_t_fix32_t(2));;






        for(uint32_t pos = m; pos < WSIZE; pos+= (L<<1)) 
        {
            uint32_t pos2 = pos+L;

            //printf("(%d, %d) ", pos,pos2);


            struct fix32_t t_r =  fix32_t_sub( fix32_t_mult(w_r, result_real[pos2] ), fix32_t_mult( w_i, result_img[pos2] )         );     //   w_r * result_real[pos2] - w_i * result_img[pos2];
            struct fix32_t t_i = fix32_t_add(fix32_t_mult(w_r, result_img[pos2]), fix32_t_mult(w_i, result_real[pos2]) );          //w_r * result_img[pos2] + w_i * result_real[pos2];

            struct fix32_t q_r = fix32_t_div(result_real[pos], int32_t_fix32_t(2));
            struct fix32_t q_i = fix32_t_div( result_img[pos], int32_t_fix32_t(2));

            //float t_r = w_r * array_get((void*) &result_real,pos2) - w_i * array_get((void*) &result_img,pos2);
            //float t_i = w_r * array_get((void*) &result_img,pos2) + w_i * array_get((void*) &result_real,pos2);
            
            //float q_r = array_get((void*) &result_real,pos)/2.;
            //float q_i = array_get((void*) &result_img,pos)/2.;

            result_real[pos2] =   fix32_t_sub(  q_r, t_r);
            result_img[pos2] = fix32_t_sub( q_i, t_i);
            result_real[pos] = fix32_t_add( q_r , t_r);
            result_img[pos] = fix32_t_add( q_i , t_i);


        }
    }
    //printf("\n");

}

}



float w(int n, int N)
{
    return 25./46. + (21./46.)*cos(2.*M_PI*(n+N/2)/N);
	
	//return 23./46. + (21./46.)*cos(2.*M_PI*(n+N/2)/N);
}


